import React from 'react';
import { Button } from 'antd';


const Buttons = () => {
  return (
    <>
      <Button type="primary" shape="round" style={{width: '500px', marginTop: '50px', height: '100px', backgroundColor:'##90FFFF', borderColor: '##0100FF', boerder: '5px soild'}}></Button>
    </>
  )
}


export default Buttons;
